import React from "react";
import { Route, Routes, Navigate } from "react-router-dom";
import ProgressBar from "react-topbar-progress-indicator";
import loadable from "@loadable/component";
import AuthRoute from "../components/protectedRoutes/AuthRoute";
import GuestRoute from "../components/protectedRoutes/GuestRoute";
import AuthRoutes from "./AuthRoutes";
import { PublicRoutes } from "./PublicRoutes";

// loadable

export const AllRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigate replace={true} to="/public" />} />
      {PublicRoutes()}
      <Route path="/403" element={<Navigate replace={true} to="/public" />} />
      <Route path="/404" element={<Navigate replace={true} to="/public" />} />
      <Route path="/406" element={<Navigate replace={true} to="/public" />} />
      <Route path="/500" element={<Navigate replace={true} to="/public" />} />
    </Routes>
  );
};
